package ra.dev.model.dto;public class ProductDTO {    private Integer productId;    private String description;    private Integer discount;    private Integer price;    private String productImg;    private String productName;    private Boolean prodcutStatus;    private Integer catalogId;    public ProductDTO(int productID, String catalogName, String productName, int discount, int price, boolean productStatus) {    }    public Integer getProductId() {        return this.productId;    }    public void setProductId(Integer productId) {        this.productId = productId;    }    public String getDescription() {        return this.description;    }    public void setDescription(String description) {        this.description = description;    }    public Integer getDiscount() {        return this.discount;    }    public void setDiscount(Integer discount) {        this.discount = discount;    }    public Integer getPrice() {        return this.price;    }    public void setPrice(Integer price) {        this.price = price;    }    public String getProductImg() {        return this.productImg;    }    public void setProductImg(String productImg) {        this.productImg = productImg;    }    public String getProductName() {        return this.productName;    }    public void setProductName(String productName) {        this.productName = productName;    }    public Boolean getProdcutStatus() {        return this.prodcutStatus;    }    public void setProdcutStatus(Boolean prodcutStatus) {        this.prodcutStatus = prodcutStatus;    }    public Integer getCatalogId() {        return this.catalogId;    }    public void setCatalogId(Integer catalogId) {        this.catalogId = catalogId;    }}